import React from "react";
import { Helmet, HelmetProvider } from "react-helmet-async";

function App() {
  return (
    <HelmetProvider>
      <div className="App">
        <Helmet>
          <title>CodeGenie AI</title>
          <meta name="description" content="AI-powered coding assistant" />
        </Helmet>

        {/* Add some UI content */}
        <h1>Welcome to CodeGenie</h1>
        <p>AI-powered coding assistant</p>
      </div>
    </HelmetProvider>
  );
}

export default App;
